INSERT INTO `systemhelp` VALUES ('1', '系统权限说明', '1、点击相应的角色名称（红字链接）可设置菜单权限。<br>2、如果需要更改角色名称和数据权限，请点击编辑。<br>3、数据权限以客户为中心，客户的周边数据（比如：联系人、合同订单、回款等）权限随着客户权限的变化而变化。数据权限目前分老板、经理、销售三级，上级可管理下级的数据：比如经理可管理下属销售人员的数据，老板可管理所有数据，同级之间数据互相隔离：比如销售和销售之间的客户互相看不到;部门和部门之间的客户互相看不到。', '1');
INSERT INTO `systemhelp` VALUES ('2', '系统菜单说明', '1、系统菜单系统分为两部分，一是<font color=red>一级菜单</font>，二是<font color=red>二级菜单</font>。\n\n2、一级菜单与二级菜单有<font color=red>内在关联</font>。\n\n3、如果你想增加菜单，那么可以先在一级菜单增加，如为<font color=red>60</font>，那么你必须在二级菜单里面添加菜单编号为<font color=red>6001</font>。\n\n4、然后在角色与权限管理里面，对你自己的角色的权限信息进行管理，加入你刚才新增的一菜单权限。\n\n5、<font color=red>刷新左边菜单</font>就可以看到新增加的菜单信息。\n\n6、图片信息说明：图片存放目录为<font color=red>Framework/image/menu</font>目录里面，系统自动为图片加入GIF后缀，如你的图片就<font color=red>logo.gif</font>,那么只在相应目录下面放如该文件，所写信息只为<font color=red>logo</font>即可。\n\n6、连接地址：系统默认的连接地址为<font color=red>Framework</font>目录里面，如果在其目录下，则直接填写:你的文件名，如果在上级目录，可以写成：<font color=red>../你的目录/你的文件名</font>。\n\n', '1');
INSERT INTO `systemhelp` VALUES ('3', '系统用户管理', '1、此权限仅对需要进行用户管理的人员进行开放;\n2、数据权限固定为三级，老板、部门经理、职员，上级能看到下级数据，同级数据隔离，老板能看到所有数据;\n3、新建用户后，可点击分配菜单功能，设置此用户能使用哪些功能;\n4、删除用户，如有客户隶属此用户，请先进行客户移交。', '1');
INSERT INTO `systemhelp` VALUES ('4', '产品管理说明', '1、产品信息分为两级目录\n\n2、第一级目录为产品供应商\n\n3、产品供应商下面设定产品分类\n\n4、产品分类下面进行产品信息设定', '1');
INSERT INTO `systemhelp` VALUES ('5', '客户报备说明', '1、客户进展状态只能由经理秘书进行设定\n\n2、客户报备由五个状态组成：报备、签约、己签约、停止、流失\n\n3、当客户状态设定为签约、己签约、停止和流失时，客户会自动出现在客户执行里面。\n\n4、当客户状态设定为签约、己签约时客户出现在业绩统计菜单里面', '1');
INSERT INTO `systemhelp` VALUES ('6', '客户执行说明', '1、客户进展状态由五个状态组成：报备、签约、己签约、停止、流失。\n\n2、当客户状态设定为签约、己签约、停止和流失时，客户会自动出现在客户执行里面。\n\n3、当客户状态设定为签约、己签约时客户出现在业绩统计菜单里面。\n\n4、经理秘书可以对客户状态进行设定', '1');
INSERT INTO `systemhelp` VALUES ('7', '业绩统计说明', '1、客户进展状态由五个状态组成：报备、签约、己签约、停止、流失。\n\n2、当客户状态设定为签约、己签约时客户出现在业绩统计菜单里面', '1');
INSERT INTO `systemhelp` VALUES ('8', '沟通信息说明', '1、本模块功能是发送信息给指定的客户人员\n\n2、发送邮件之前，请先配置好发送邮件的SMTP协议信息，具体在左边菜单“沟通信息设置”，“邮件配置”里面进行。\n\n3、发送客户的名单在“沟通人”选项里面设定，可以设定多个沟通人姓名\n\n4、发送客户的邮件地址在“邮件”选项里面设定，可以设定多个邮件地址\n\n5、发送邮件的内容，可以在预览选项里面看到，即发送的格式及内容\n\n6、发送格式的模版文件是www/Interface/CRM/communication_template.html 可以修改此文件，对发送出去的邮件格式进行修改。\n\n7、发送格式的预览模版是crm_communication_preview.html 可以修改此文件，对预览模版进行修改。\n\n', '1');
INSERT INTO `systemhelp` VALUES ('9', '入库退货操作说明', '1、每项入库单据只能在<font color=green>入库流转审批以后</font>才能发生退货处理。\n\n2、每荐入库单据只能<font color=green>处理入库退货流程一次</font>。\n\n3、处理完成退货处理以后行记录可修改项<font color=green>变为灰色</font>，不能再进行退货处理。', '1');
INSERT INTO `systemhelp` VALUES ('10', '出库退货操作说明', '1、每项出库单据只能在<font color=green>出库流转审批以后</font>才能发生退货处理。\n\n2、每荐出库单据只能<font color=green>处理入库退货流程一次</font>。\n\n3、处理完成退货处理以后行记录可修改项<font color=green>变为灰色</font>，不能再进行退货处理。', '1');
INSERT INTO `systemhelp` VALUES ('11', '入库操作说明', '1、入库单由采购单生成，不能单独新建入库单，采购单生成入库单后，入库单据状态为<font color=red>未入库</font>。<br>2、库管确认，只有此仓库的管理员有权限确认（仓库管理员在仓库管理功能中设置），确认后单据状态为<font color=green>已入库</font>，至此完成入库。', '1');
INSERT INTO `systemhelp` VALUES ('12', '出库操作说明', '1、出库单由销售订单生成，不能单独新建出库单，订单生成出库单后，出库单据状态为<font color=red>未出库</font>。<br>2、库管确认，只有此仓库的管理员有权限确认（仓库管理员在仓库管理功能中设置），确认后单据状态为<font color=blue>已出库</font>，等待订单创建人发货。<br>3、如果库管本人就是订单创建人，可以直接发货，发货完毕后，状态为<font color=green>已发货</font>，出库流程结束。', '1');
INSERT INTO `systemhelp` VALUES ('13', '采购计划管理操作说明', '1、采购计划可<font color=red>生成采购订单</font>。\n\n2、采购计划可直接<font color=red>生成入库单据</font>。\n\n3、采购计划单据发生流转以后<font color=red>不能进行再修改</font>。', '1');
INSERT INTO `systemhelp` VALUES ('14', '采购计划流转管理说明', '1、此部分对采购计划进行<font color=red>流转审批</font>。\n\n2、审批完成以后，可以选择生成采购订单，也可以选择直接生成入库单据。\n\n3、数据的执行状态变为<font color=red>部分执行</font>或<font color=red>全部执行</font>时，<font color=red>不能对单据进行反流转操作</font>。\n\n4、采购计划单据在<font color=red>部分或全部</font>生成订单或入库单据时，会显示<font color=red>部分执行</font>或<font color=red>全部执行</font>的数据状态。', '1');
INSERT INTO `systemhelp` VALUES ('15', '采购订单生成管理', '1、主要是针对从<font color=red>采购计划单据</font>到<font color=red>采购订单单据</font>生成的模块。\n\n2、此部分对<font color=red>采购计划明细重新进行组织，形成所希望的采购采购订单单据</font>，并使采购订单单据状态处于<font color=red>制单状态</font>。', '1');
INSERT INTO `systemhelp` VALUES ('16', '采购入库生成管理', '1、主要是针对从<font color=red>采购计划单据</font>到<font color=red>入库单据</font>生成的模块。\n\n2、此部分对<font color=red>采购计划明细重新进行组织，形成所希望的入库单据</font>，并使入库单据状态处于<font color=red>制单状态</font>。', '1');
INSERT INTO `systemhelp` VALUES ('17', '采购订单入库生成管理', '1、主要是针对从<font color=red>采购订单单据</font>到<font color=red>入库单据</font>生成的模块。\n\n2、此部分对<font color=red>采购订单明细重新进行组织，形成所希望的入库单据</font>，并使入库单据状态处于<font color=red>制单状态</font>。', '1');
INSERT INTO `systemhelp` VALUES ('18', '采购订单管理', '1、采购单有三种状态：<font color=blue>执行中</font>、<font color=green>完成</font>、<font color=red>撤销</font>。\r\n2、入库状态分为：<font color=orange>需要</font>、<font color=blueviolet>已录明细</font>、<font color=red>待入库</font>、<font color=blue>部分</font>、<font color=green>全部</font>，录入明细的总额要跟单据总额一致，然后生成入库单，库管确认入库。\r\n3、付款状态分为：<font color=orange>未付</font>、<font color=blue>部分</font>、<font color=green>已付</font>，可在财务管理-》付款管理-》付款记录中增加删除。\r\n4、收票状态分为：<font color=orange>需要</font>、<font color=blue>部分</font>、<font color=green>已开</font>，可在财务管理-》付款管理-》收票记录中增加删除。\r\n5、如要撤销入库单，必须先撤销入库记录。 ', '1');
INSERT INTO `systemhelp` VALUES ('19', '采购订单流转', '1、此部分对采购订单进行<font color=red>流转审批</font>。\n\n2、审批完成以后，可以选择直接生成入库单据。\n\n3、数据的执行状态变为<font color=red>部分执行</font>或<font color=red>全部执行</font>时，<font color=red>不能对单据进行反流转操作</font>。\n\n4、采购订单单据在<font color=red>部分或全部</font>生成订单或入库单据时，会显示<font color=red>部分执行</font>或<font color=red>全部执行</font>的数据状态。', '1');
INSERT INTO `systemhelp` VALUES ('20', '商品信息使用说明', '1、商品信息<font color=red>三个销售价格</font>，<font color=red>默认为第一个零售价格</font>。\n\n2、在销售的客户列表中，可以选择其<font color=red>客户使用的价格类型</font>，对应到商品信息中的销售价格。', '1');
INSERT INTO `systemhelp` VALUES ('21', '库存调拨说明', '1、新建调拨单，选择“调出仓”和“调入仓”，保存后单据状态为<font color=red>空单</font>。<br>2、录入调拨明细，保存后单据状态为<font color=orange>已录明细</font>。<br>3、出库库管确认，只有此仓库的管理员有权限确认（仓库管理员在仓库管理功能中设置），确认后单据状态为<font color=blue>出库已确认</font>。<br>4、入库库管确认，只有此仓库的管理员有权限确认（仓库管理员在仓库管理功能中设置），确认后单据状态为<font color=green>入库已确认</font>,至此调拨单完结。<br>5、出库库管或入库库管确认后的单子不能再编辑或删除。', '1');
INSERT INTO `systemhelp` VALUES ('22', '库存初始化说明', '1、已存在库存的仓库不能进行初始化，初始化操作只能进行一次。<br>2、只有此仓库的管理员有权限进行初始化（仓库管理员在仓库管理功能中设置）<br>3、初始化操作后将自动产生一个入库单，状态为<font color=green>已入库</font><br>4、要撤销初始化操作，可删除其产生的入库单即可。', '0');
INSERT INTO `systemhelp` VALUES ('23', '库存盘点单说明', '1、只有仓库的管理员有权限对所管辖的仓库进行盘点（仓库管理员在仓库管理功能中设置）;<br>2、新建库存盘点单，状态为<font color=red>盘点中</font>;<br>3、点击录入盘点明细，只需录入实际库存与账面存在差异的产品，实际比账面多则输入正数，实际比账面少则输入负数，保存后账面库存会变更并与实际库存一致，单据状态为<font color=green>盘点结束</font>;<br>4、要撤销盘点操作，直接删除盘点单即可。', '0');
INSERT INTO `systemhelp` VALUES ('24', '生产组装单说明', '1、将一种或多种产品组装成另一种或多种产品，新建选择“出库仓库”和“入库仓库”，保存后单据状态为<font color=red>空单</font>。<br>2、出库录入，只有此仓库的管理员有权限录入（仓库管理员在仓库管理功能中设置），保存后单据状态为<font color=blue>出库已确认</font>。<br>3、入库录入，只有此仓库的管理员有权限录入（仓库管理员在仓库管理功能中设置），入库金额必须和出库金额保持一致，确认后单据状态为<font color=green>入库已确认</font>,至此生产组装单完结。', '0');
INSERT INTO `systemhelp` VALUES ('25', '销售机会说明', '1、销售机会主要管理销售过程中的售前部分，或者说从一个销售机会的确立到签署合同之间的过程管理。销售机会的跟踪是一个延续性的工作，在这期间很多数据会不断地变化，比如阶段、可能性、状态等，只有及时地更新这些数据，系统才能正常的发挥作用，比如销售漏斗、销售预测等。', '0');
INSERT INTO `systemhelp` VALUES ('26', '产品报价说明', '1、新建报价单保存后，方可编辑明细，金额根据明细自动计算。<br>2、报价单需上级审核同意才能打印、导出及生成订单。<br>3、生成订单后，将会在订单管理中看到。', '0');
INSERT INTO `systemhelp` VALUES ('31', '客户管理', '1、私有客户只能被隶属人及其上级用户看到，同级之间数据隔离，公共客户所有人都能看到;\r\n2、公共客户只能被隶属人及其上级用户编辑删除，其他用户只能查看;\r\n3、客户名称和电话不能同时重复，导入时系统会自动判断;', '0');
INSERT INTO `systemhelp` VALUES ('32', '银行账号管理', '1、设置了专属人，则只有专属人有权使用此账户，并且此用户无权访问其他账户。', '0');
INSERT INTO `systemhelp` VALUES ('33', '销售单录入', '1、点新增按钮录入销售单，录完明细保存后单据状态为“临时单”，临时单可以编辑删除，修改明细;\r\n2、临时单列表右侧点“收款”进入收款界面，保存后自动生成收款记录、出库记录，单据状态变更为完成，如果还未付款或者尚未发货，则单据状态为执行中;\r\n3、对于未付款的，可在 统计分析->应收款汇总，进行查询和批量收款;\r\n4、发货操作在 库存管理->发货单 中操作。\r\n5、如要撤销单据，必须先删除对应的收款记录、出库记录、开票记录，单据状态重新回到临时单状态，方可进行修改、删除。', '0');
INSERT INTO `systemhelp` VALUES ('34', '销售订单', '1、单据状态分为&lt;font color=orange&gt;临时单&lt;/font&gt;、&lt;font color=blue&gt;执行中&lt;/font&gt;、&lt;font color=green&gt;完成&lt;/font&gt;、&lt;font color=red&gt;撤销&lt;/font&gt;，只有在临时单状态下才能进行编辑、添加明细、删除操作。\r\n2、付款状态分为&lt;font color=orange&gt;未付&lt;/font&gt;、&lt;font color=blue&gt;部分&lt;/font&gt;、&lt;font color=green&gt;已付&lt;/font&gt;，可在财务管理-》汇款管理-》回款记录中进行新增和删除。\r\n3、发货状态分为&lt;font color=orange&gt;需要&lt;/font&gt;、&lt;font color=red&gt;待出库&lt;/font&gt;、&lt;font color=blueviolet&gt;待发货&lt;/font&gt;、&lt;font color=blue&gt;部分&lt;/font&gt;、&lt;font color=green&gt;全部&lt;/font&gt;，相应出库和发货操作需要库管协助，在库存管理-》出库单、发货单中操作。\r\n4、开票状态分为&lt;font color=orange&gt;需要&lt;/font&gt;、&lt;font color=blue&gt;部分&lt;/font&gt;、&lt;font color=green&gt;全部&lt;/font&gt;，可在财务管理-》回款管理-》开票记录中进行新增和删除。\r\n5、点生成出库单，选择仓库，将新建一个出库单，并等待库管确认，库管可以修改数量并确认出库，出库后会生成一个发货单，发货员确认发货。\r\n6、如要撤销单据，必须先删除对应的收款记录、出库记录、开票记录，单据状态重新回到临时单状态，方可进行修改、删除。', '0');
INSERT INTO `systemhelp` VALUES ('35', '销售合同', '1、单据状态分为&lt;font color=orange&gt;临时单&lt;/font&gt;、&lt;font color=blue&gt;执行中&lt;/font&gt;、&lt;font color=green&gt;完成&lt;/font&gt;，只有在临时单状态下才能进行编辑、删除操作。\r\n2、付款状态分为&lt;font color=orange&gt;未付&lt;/font&gt;、&lt;font color=blue&gt;部分&lt;/font&gt;、&lt;font color=green&gt;已付&lt;/font&gt;，可在财务管理-》汇款管理-》回款记录中进行新增和删除。\r\n3、交付状态分为&lt;font color=orange&gt;需要&lt;/font&gt;、&lt;font color=blue&gt;部分&lt;/font&gt;、&lt;font color=green&gt;全部&lt;/font&gt;，先生成交付计划，再进行交付，直到累计交付金额等于合同金额，交付状态为全部。\r\n4、开票状态分为&lt;font color=orange&gt;需要&lt;/font&gt;、&lt;font color=blue&gt;部分&lt;/font&gt;、&lt;font color=green&gt;全部&lt;/font&gt;，可在财务管理-》回款管理-》开票记录中进行新增和删除。\r\n5、如要撤销单据，必须先删除对应的收款记录、交付记录，开票记录，单据状态重新回到临时单状态，方可进行修改、删除。', '0');
INSERT INTO `systemhelp` VALUES ('36', '仓库管理', '1、只有仓库管理员有权限做出入库操作;\r\n', '1');
INSERT INTO `systemhelp` VALUES ('37', '工作报告', '1、上级能看到下级的报告，同级隔离;\r\n2、本部门经理有权审核本部门员工的报告;\r\n3、老板有权审核所有人的报告;\r\n4、上级部门经理有权审核下级部门经理的报告。', '0');
