  `民族` varchar(100) NOT NULL default '',
  `政治面貌` varchar(50) NOT NULL default '',
  `身份证号` varchar(100) NOT NULL default '',
  `户口` varchar(50) NOT NULL default '',
  `籍贯` varchar(100) NOT NULL default '',
  `社保号` varchar(100) NOT NULL default '',
  `地址` varchar(255) NOT NULL default '',
  `邮编` varchar(8) NOT NULL default '',
