  `外语语种` varchar(100) NOT NULL default '',
  `外语水平` varchar(100) NOT NULL default '',
  `何时工作` date NOT NULL,
  `工龄` int(11) NOT NULL,
  `工作状态` varchar(100) NOT NULL default '',
  `特长` text NOT NULL,
  `备注` text NOT NULL,
  `附件` varchar(100) NOT NULL default '',
  `照片` varchar(100) NOT NULL default '',
  `入本单位日期` date NOT NULL,
  `本单位工龄` int(11) NOT NULL,
  `离职日期` date NOT NULL,
  `本次合同签日` date NOT NULL,
  `本次合同终止日期` date NOT NULL,
  `离退休日期` date NOT NULL,
  `离退休年龄` int(11) NOT NULL,
  `用工形式` varchar(100) NOT NULL default '',
  `首次签合同日期` date NOT NULL,
  `技能等级` varchar(100) NOT NULL default '',
  `技能鉴定日期` date NOT NULL,
  `岗位类别` varchar(100) NOT NULL default '',
  `岗位名称` varchar(100) NOT NULL default '',
  `岗位技能分数` int(11) NOT NULL,
  `开户银行` varchar(200) NOT NULL default '',
  `银行账号` varchar(255) NOT NULL default '',
  `工资等级` varchar(100) NOT NULL default '',
  `员工阴历生日` date NOT NULL,
  `个人描述` text NOT NULL,
  `护照` varchar(100) NOT NULL default '',
  `血型` varchar(10) NOT NULL default '',
  `身高` varchar(100) NOT NULL default '',
  `体重` varchar(100) NOT NULL default '',
  `视力` varchar(100) NOT NULL default '',
  `健康状况` varchar(100) NOT NULL default '',
  `驾照` varchar(50) NOT NULL default '',
  `工作经历` text NOT NULL,
  `工作经历附件` varchar(200) NOT NULL default '',
  `社会关系` text NOT NULL,
  `社会关系附件` varchar(200) NOT NULL default '',
  `复职日期` date NOT NULL,
  PRIMARY KEY  (`编号`),
  KEY `工号` (`工号`),
  KEY `姓名` (`姓名`),
  KEY `学历` (`学历`),
  KEY `民族` (`民族`),
  KEY `所属部门` (`所属部门`)
) ENGINE=MyISAM AUTO_INCREMENT=7 DEFAULT CHARSET=gbk COMMENT='人事档案';

