DROP VIEW IF EXISTS `stockinmain_view`;
CREATE ALGORITHM=MERGE DEFINER=`root`@`127.0.0.1` SQL SECURITY DEFINER VIEW `stockinmain_view` AS select `a`.`id` AS `id`,`a`.`prodid` AS `prodid`,`a`.`prodname` AS `prodname`,`a`.`prodguige` AS `prodguige`,`a`.`prodxinghao` AS `prodxinghao`,`a`.`proddanwei` AS `proddanwei`,`a`.`price` AS `price`,`a`.`zhekou` AS `zhekou`,`a`.`num` AS `num`,`a`.`beizhu` AS `beizhu`,`a`.`mainrowid` AS `mainrowid`,`a`.`jine` AS `jine`,`b`.`storeid` AS `storeid`,`b`.`indate` AS `indate`,`b`.`state` AS `state`,`b`.`intype` AS `intype`,`c`.`oldproductid` AS `oldproductid` from ((`stockinmain_detail` `a` join `stockinmain` `b` on((`a`.`mainrowid` = `b`.`billid`))) join `product` `c` on((`a`.`prodid` = `c`.`productid`))) ;

-- ----------------------------
-- View structure for `stockoutmain_view`
-- ----------------------------
DROP VIEW IF EXISTS `stockoutmain_view`;
CREATE ALGORITHM=MERGE DEFINER=`root`@`127.0.0.1` SQL SECURITY DEFINER VIEW `stockoutmain_view` AS select `a`.`id` AS `id`,`a`.`prodid` AS `prodid`,`a`.`prodname` AS `prodname`,`a`.`prodguige` AS `prodguige`,`a`.`prodxinghao` AS `prodxinghao`,`a`.`proddanwei` AS `proddanwei`,`a`.`price` AS `price`,`a`.`zhekou` AS `zhekou`,`a`.`num` AS `num`,`a`.`beizhu` AS `beizhu`,`a`.`mainrowid` AS `mainrowid`,`a`.`jine` AS `jine`,`a`.`avgprice` AS `avgprice`,`a`.`lirun` AS `lirun`,`b`.`storeid` AS `storeid`,`b`.`outdate` AS `outdate`,`b`.`state` AS `state`,`b`.`outtype` AS `outtype` from (`stockoutmain_detail` `a` join `stockoutmain` `b` on((`a`.`mainrowid` = `b`.`billid`))) ;

-- ----------------------------
-- View structure for `store_product`
-- ----------------------------
DROP VIEW IF EXISTS `store_product`;
CREATE ALGORITHM=MERGE DEFINER=`root`@`127.0.0.1` SQL SECURITY DEFINER VIEW `store_product` AS select `b`.`id` AS `id`,`b`.`prodid` AS `prodid`,`b`.`num` AS `num`,`b`.`price` AS `price`,`b`.`storeid` AS `storeid`,`b`.`memo` AS `memo`,(`b`.`num` * `b`.`price`) AS `totalmoney`,`a`.`productname` AS `productname`,`a`.`measureid` AS `measureid`,`a`.`mode` AS `mode`,`a`.`standard` AS `standard`,`a`.`producttype` AS `producttype`,`a`.`storemin` AS `storemin`,`a`.`storemax` AS `storemax`,`a`.`user_flag` AS `user_flag`,`a`.`sellprice` AS `sellprice`,`a`.`productcn` AS `productcn`,`a`.`sellprice2` AS `sellprice2`,`a`.`sellprice3` AS `sellprice3`,`a`.`fileaddress` AS `fileaddress`,`a`.`oldproductid` AS `oldproductid`,((`a`.`sellprice` - `b`.`price`) * `b`.`num`) AS `lirun`,`a`.`supplyid` AS `supplyid` from (`product` `a` join `store` `b` on((`a`.`productid` = `b`.`prodid`))) ;

