CREATE ALGORITHM=MERGE DEFINER=`root`@`127.0.0.1` SQL SECURITY DEFINER VIEW `v_accessbank` AS select `accessbank`.`id` AS `编号`,`accessbank`.`bankid` AS `银行账户`,`accessbank`.`oldjine` AS `期初`,if((`accessbank`.`jine` > 0),`accessbank`.`jine`,_utf8'') AS `收入`,if((`accessbank`.`jine` < 0),-(`accessbank`.`jine`),_utf8'') AS `支出`,(`accessbank`.`oldjine` + `accessbank`.`jine`) AS `余额`,`accessbank`.`opertype` AS `操作类型`,`accessbank`.`guanlianbillid` AS `关联单号`,`accessbank`.`createman` AS `创建人`,`accessbank`.`createtime` AS `创建时间` from `accessbank` ;

